import React, {useEffect} from 'react';
import { useState } from 'react';


const Welcome = () => {
    const [userData, setUserData] = useState({}); 

    const callWelcome = async () => {
        try{
            fetch('/About')
            .then(function(res){
            console.log(res.json());
            })
        }
        catch(err)
        {
            console.log(err)
        }
    }
    useEffect( () => {
      callWelcome()      
    }, []);

    return (
        <>
        <div className="aaa">
            <form method="GET">
            <p>Welcome {userData.name}</p>
            </form>
        </div>
        </>
    )

}

export default Welcome;
